    true,nt"url": null,nt"notes": "The Human Mitochondrial Protein Database
    (HMPDb) provides comprehensive data on mitochondrial and human nuclear encoded proteins
    involved in mitochondrial biogenesis and function. This database consolidates information
    from SwissProt, LocusLink, Protein Data Bank (PDB), GenBank, Genome Database (GDB),
    Online Mendelian Inheritance in Man (OMIM), Human Mitochondrial Genome Database
    (mtDB), MITOMAP, Neuromuscular Disease Center and Human 2-D PAGE Databases. This
    database is intended as a tool not only to aid in studying the mitochondrion but
